import * as fm from "../fetch";
export class Query {
    static Epoch(req, initReq) {
        return fm.fetchReq(`/sei-protocol/seichain/epoch/epoch?${fm.renderURLSearchParams(req, [])}`, {
            ...initReq,
            method: "GET"
        });
    }
    static Params(req, initReq) {
        return fm.fetchReq(`/sei-protocol/seichain/epoch/params?${fm.renderURLSearchParams(req, [])}`, {
            ...initReq,
            method: "GET"
        });
    }
}
